import Vue from 'vue'
import App from './App.vue'
import {Tree,Row,Col} from "element-ui"

Vue.config.productionTip = false
Vue.component(Tree.name,Tree);
Vue.component(Row.name,Row);
Vue.component(Col.name,Col);
new Vue({
  render: h => h(App),
  beforeCreate(){
    Vue.prototype.$bus = this;
  }
}).$mount('#app')
